from typing import List, TypedDict

class Point:
    def __init__(self, x: int, y: int, weight: int):
        self.x = x
        self.y = y
        self.weight = weight
        self.shortest_path = sys.maxsize

    def __repr__(self):
        return f'row = {self.x} column = {self.y} weight = {self.weight} shortest path = {self.shortest_path}'

    def __key(self):
        # Tuples are hashed efficiently by default.
        # https://stackoverflow.com/questions/2909106/whats-a-correct-and-good-way-to-implement-hash
        return (self.x, self.y)

    def __hash__(self):
        return hash(self.__key())

    # Creating a custom hash function takes both a unique hash and a custom equals method.
    def __eq__(self, other):
        if isinstance(other, Point):
            return self.__key() == other.__key()
        return NotImplemented

# Avoid cycles.
class Visited(TypedDict):
    key: tuple[int, int]
    val: bool

class HeapElement:
    def __init__(self, point: Point, path_sum: int, visited: Visited):
        self.point = point
#        self.visited = visited
        self.path_sum = path_sum

    def __repr__(self):
        return f'Point {self.point} path sum {self.path_sum}' #visited = {self.visited}'

    def __lt__(self, other):
        return self.path_sum < other.path_sum

class Solution:
    def reachedDestination(self, grid: List[List[int]], point: Point):
        if point.x == len(grid) - 1 and point.y == len(grid[0]) - 1:
            return True
        
    def searchMatrixForTheAnswer(self, grid: List[List[int]], candidate_paths: List[int]):
        while len(candidate_paths) > 0:
            # Pop an element from the priority queue.
            # Do all accounting for the element and mark it as visited.
            popped = heapq.heappop(candidate_paths)
            next_p = popped.point
            #print(f'candidate_paths = {candidate_paths}\n next point = {next_p}')
            #pdb.set_trace()

#            if (next_p.x, next_p.y) in popped.visited:
                # cycle, avoid this path. Since edge wts are positive we do not need to update
                # the shortest path.
 #               continue

#            popped.visited[(next_p.x, next_p.y)] = True
            popped.path_sum += next_p.weight
            # Not the shortest path to this point, there is no need to explore neighbors.
            if next_p.shortest_path > popped.path_sum:
                next_p.shortest_path = popped.path_sum
                #if self.reachedDestination(grid, next_p) and next_p.shortest_path == 79:
                #    print(f'path distance: {next_p.shortest_path} path:')
                #    for k in popped.visited.keys():
                #        print(f'x: {k.x} y: {k.y} weight: {k.weight}')

            else:
                continue

            # We have not explored the neighbors for next_p yet.
            neighbors = [None, None, None, None]

            right_x = next_p.x
            right_y = None if next_p.y == len(grid[0]) - 1 else next_p.y + 1
            if right_x is not None and right_y is not None:
                neighbors[0] = grid[right_x][right_y]

            # Apparently this is not allowed.
            #left_x = next_p.x
            #left_y = None if next_p.y == 0 else next_p.y - 1
            #if left_x is not None and left_y is not None:
            #    neighbors[1] = grid[left_x][left_y]

            down_x = None if next_p.x == len(grid) - 1 else next_p.x + 1
            down_y = next_p.y
            if down_x is not None and down_y is not None:
                neighbors[2] = grid[down_x][down_y]

            #up_x = None if next_p.x == 0 else next_p.x - 1
            #up_y = next_p.y
            #if up_x is not None and up_y is not None:
            #    neighbors[3] = grid[up_x][up_y]

            for neighbor in neighbors:
                if neighbor == None:# or neighbor in popped.visited:
                    continue

                # Construct a new heap element and push it on to the heap.
                # Don't need to do deepcopy here because once we turn right,
                # or go down, the two paths diverged irreconcibly.
                new_el = copy.copy(popped)
                new_el.point = neighbor
                heapq.heappush(candidate_paths, new_el)
        return
        
    def minPathSum(self, grid: List[List[int]]) -> int:
        if len(grid) == 0 or len(grid[0]) == 0:
            return 0
        # create a grid of points.
        g = []
        for row_idx, row in enumerate(grid):
            g.append([])
            for col_idx, col in enumerate(row):
                g[row_idx].append(Point(row_idx, col_idx, col))
        # Start from top left
        heap_list = [HeapElement(g[0][0], 0, Visited())]
        heapq.heapify(heap_list)
        self.searchMatrixForTheAnswer(g, heap_list)
        return g[len(grid) - 1][len(grid[0]) - 1].shortest_path

